import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Register from "./components/Auth/Register";
import Login from "./components/Auth/Login";
import CarList from "./components/Cars/CarList";
import CarUploadForm from './components/Cars/CarUploadForm';
import { AuthProvider } from './context/AuthContext'; // ✅ use AuthProvider here

function App() {
  return (
    <AuthProvider> {/* ✅ Wrap the whole app in AuthProvider */}
      <Router>
        <nav>
          <Link to="/">Cars</Link> | 
          <Link to="/upload-car">Upload Car</Link> | 
          <Link to="/login">Login</Link> | 
          <Link to="/register">Register</Link>
          <Link to="/logout">logout</Link>
        </nav>

        <Routes>
          <Route path="/" element={<CarList />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/upload-car" element={<CarUploadForm />} />
          <Route path="/logout" element={<logout />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
